import './App.css';
import ScriptTag from 'react-script-tag';
import { useStickyState } from "./hooks/useStickyState";


export default function App() {
  const [state, setState] = useStickyState(1, "sketchstate");

  return (
    <div className="App">

      <ScriptTag type="text/javascript" src="sketch.js" />

      <div class="gui">
        <div class="gui-border"></div>
        <button class="btnR" onClick={() => {
          return setState(Math.abs(2));
        }} >This is the forward button {state} </button>

        <button class="btnL" onClick={() => {
          return setState(Math.abs(1));
        }} >This is the back button {state} </button>

        {/* <button class="btnC" onClick={() => {
          return setState(Math.abs(1));
        }} >This is a center button {state} </button> */}
      </div>
    </div>
  );
}
